\fs22 \cf2 \expnd0\expndtw0\kerning0 Using only sequences pairs from category 1 above (with matching barcodes), we attempt to assemble them. This consists in finding the matching overlap between the end of the forward read and the end of the reverse read. We use the PANDAseq algorithm for this:\ \pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720 {\field{\*\fldinst{HYPERLINK "http://www.biomedcentral.com/1471-2105/13/31"}}{\fldrslt \cf3 \expnd0\expndtw0\kerning0 \ul \ulc3 http://www.biomedcentral.com/1471-2105/13/31}} \ \ \ \ \ \ \ \ This provides some type of quality filtering, as sequences with badly sequenced base pairs will likely not assemble and be rejected.}

